import React, { Fragment, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { FETCH_CARDS_START } from '../../redux/reducers/cardReducer';

const Card = () => {
  const login = useSelector((state) => state.sagaLogin, []);
  const { following, follower } = useSelector((state) => state.follow, []);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch({ type: FETCH_CARDS_START, payload: login.username });
  }, []);
  return (
    <Fragment>
      <div className="left_content">
        <div className="card">
          <div>
            <span>이름</span>
          </div>
          <div>
            내용
          </div>
        </div>
      </div>
      <style jsx>
        {`
          .left_content{
            float:left;
            width:69%;
            margin-right: 1%;
          }
        `}
      </style>
    </Fragment>
  );
};

export default Card;
